import React, { useState, useEffect } from 'react';
import { Container } from 'react-bootstrap';
import AOS from 'aos';
import 'aos/dist/aos.css';

const NextPage = () => {
  const [hovered, setHovered] = useState(false);

  useEffect(() => {
    AOS.init({ duration: 1000 });
  }, []);

  const h1Style = {
    textTransform: 'uppercase',
    fontFamily: 'Anton, sans-serif',
    lineHeight: 1.0,
    letterSpacing: '0.00em',
    fontSize: '9vw',
    fontWeight: '900',
    color: 'white',
    transform: 'scaleX(1.1)', // Stretch on X-axis
    WebkitTextStroke: hovered ? '1px white' : '0px', // WebKit variant on hover
    transition: 'all 0.4s ease-in-out',
  };

  return (
    <div
      style={{
        backgroundColor: 'black',
        color: 'white',
        paddingTop: '2rem',
        paddingBottom: '2rem',
      }}
      data-aos="flip-left"
    >
      <Container className="text-end" style={{ position: 'relative', zIndex: 2 }}>
        <div className="fs-2 py-4 fw-bold">Next Project</div>
        <div
          style={h1Style}
          onMouseEnter={() => setHovered(true)}
          onMouseLeave={() => setHovered(false)}
        >
          Push
        </div>
      </Container>
    </div>
  );
};

export default NextPage;
